import { useRouter } from "next/router";

import Layout from "../../components/Layout";

const Paint = props => {
  const router = useRouter();
  console.log(router.query.id);

  return (
    <Layout>
      <h1>{router.query.id}</h1>
    </Layout>
  );
};

export default Paint;
